import React, { useEffect, useState } from 'react';
import axios from 'axios';

const RFIDTags = () => {
  const [rfidTags, setRfidTags] = useState([]);

  useEffect(() => {
    const eventSource = new EventSource('/sse');

    eventSource.onmessage = (event) => {
      const newRfidTags = JSON.parse(event.data);
      setRfidTags(newRfidTags);
    };

    return () => {
      eventSource.close();
    };
  }, []);

  return (
    <div>
      <h1>RFID Tags Count: {rfidTags.length}</h1>
      <ul>
        {rfidTags.map((tag, index) => (
          <li key={index}>{tag}</li>
        ))}
      </ul>
    </div>
  );
};

export default RFIDTags;
